import React from 'react'
import { Navigate } from 'react-router-dom';
const Landing = () => {

    if(localStorage.token)
    {
        return(
            <div className='App-header'>
                <h3 className='App-header'> Landing </h3>
                    <iframe title='ElevenHealth' src="https://sense-demo.qlik.com/sso/single/?appid=cd840389-f841-4477-86be-532fb0b13775&sheet=aLvPhq&opt=ctxmenu,currsel" style="border:none;width:100%;height:100%;"></iframe>
            </div>
        );
    }
    else {
        return <Navigate to="/" />;
    }
}

export default Landing;
